import React , { useState} from "react";





function Signup(){


  return (
    
    <div id={"signup-page"}>
    <div id={"signup-header"}>
        <div id={"signup-backButton"}>
            <a href={"/login"}
               className={"arrow left"}>
            </a>
        </div>

        <div id={"signup-signupText"}>
            <h3> Sign Up </h3>
        </div>
        
    </div>

    <p id = "signup-subtitle">Lorem ipsum dolor sit amet, consectetur adipiscing elit</p>
    <div>
        <input id="signup-Input" type="text" placeholder="Full Name" ></input><br></br>
        <input id="signup-Input" type="email" placeholder="Email" ></input><br></br>
        <input id="signup-Input" type="text" placeholder="Password" ></input><br></br>
        <input id="signup-Input" type="text" placeholder="Confirm Password" ></input><br></br>
    </div>
    </div>
    
      
      
  );

}

  
export default Signup;
